        /**
         * 设置行、列、单元格的样式以及悬浮提示框
         * jsapi
         * */
        addEffect: function (type, opts) {
            if (FR.isNull(opts) || FR.isNull(type)) {
                return;
            }

            if (type === 'showTooltip') {
                var address = opts['address'];
                var text = opts['text'];
                var image = opts['image'];
                if (!FR.isNull(text)) {
                    this.makeHoverTooltip(address, text);
                } else if (!FR.isNull(image)) {
                    this.makeHoverImageTooltip(address, image);
                }
                return;
            }

            var trigger = opts['trigger'];
            var single = opts['single'];
            if (FR.isNull(trigger)) {
                trigger = 'mouseover';
            }
            if (FR.isNull(single)) {
                single = true;
            }
            if (single === true) {
                if (type === 'highlightRow') {
                    this.makeHighlightLine(opts['color'], trigger);
                } else if (type === 'highlightCol') {
                    this.makeHighlightColumn(opts['color'], trigger);
                } else if (type === 'highlightCross') {
                    this.makeHighlightCross(opts['color'], trigger);
                } else if (type === 'highlightCell') {
                    this.makeHighlightCell(opts['color'], trigger);
                } else if (type === 'setCellFont') {
                    this.makeFontCell(opts['style'], trigger);
                } else if (type === 'setRowFont') {
                    this.makeFontLine(opts['style'], trigger);
                }
            } else if (single === false) {
                if (type === 'highlightRow') {
                    this.makeHighlightLineHold(opts['color'], trigger);
                } else if (type === 'highlightCol') {
                    this.makeHighlightColumnHold(opts['color'], trigger);
                } else if (type === 'highlightCross') {
                    this.makeHighlightCrossHold(opts['color'], trigger);
                } else if (type === 'highlightCell') {
                    this.makeHighlightCellHold(opts['color'], trigger);
                } else if (type === 'setCellFont') {
                    this.makeFontCellHold(opts['style'], trigger);
                } else if (type === 'setRowFont') {
                    this.makeFontLineHold(opts['style'], trigger);
                }
            }
        },

