        directExportToExcel: function (dsName, fileName, params, colNames, exportFormat, encodeFormat) {
            if (this.fireEvent(FR.Events.BTOEXCEL) === false) {
                return;
            }
            var sessionID = this.currentSessionID;
            var url = FR.servletURL + "?op=export&cmd=direct_excel&sessionID=" + sessionID + "&dsName=" + dsName;
            if (fileName !== undefined) {
                url += "&fileName=" + fileName
            }
            if (params !== undefined) {
                url += "&params=" + params;
            }
            if (colNames !== undefined) {
                url += "&colNames=" + colNames;
            }
            if (exportFormat !== undefined) {
                url += "&exportFormat=" + exportFormat;
            }
            if (encodeFormat  !== undefined) {
                url += "&encodeFormat=" + encodeFormat;
            }

            FR.ajax({
                url: FR.servletURL + '?op=export&cmd=direct_excel_check',
                type: 'POST',
                data: {
                    dsName: dsName,
                    sessionID: sessionID
                },
                complete: function (res) {
                    var ro = FR.jsonDecode(res.responseText);
                    if (ro.status === 0) {
                        var dialog = FR.createExceptionDialog(ro.errorInfo, {sessionID: sessionID});
                        dialog.setVisible(true);
                        return;
                    } else if (ro.status === 3) {
                        var dialog = FR.createTimeoutDialog();
                        dialog.setVisible(true);
                        return;
                    }

                    FR.openUrlByForm(url);
                    var config = {
                        sessionID: sessionID,
                        exportFormat: exportFormat,
                        polling: {
                            url: FR.servletURL + '?op=export&cmd=direct_excel_polling'
                        },
                        resume: {
                            url: FR.servletURL + '?op=export&cmd=direct_excel_resume'
                        },
                        stop: {
                            url: FR.servletURL + '?op=export&cmd=direct_excel_stop'
                        }

                    }
                    FR.checkProgress.call({
                        createProgressBar: function () {
                            if ($('#progressBar').length <= 0) {
                                var progressBar = $('<div id = ' + '\"' + 'progressBar' + '\"' + '>' + '</div>').appendTo("body");
                                var tips = $('<div>' + FR.i18nText("Fine-Engine_Exporting") + '...' + '</div>').appendTo($('#progressBar'));
                                var $maskDiv = $('<div id="transparent_mask" style="position:absolute;filter:alpha(opacity=50);opacity:0.5;"></div>');
                                $maskDiv.css('left', "0px").css('top', "0px").css('width', "100%").css('height', "100%").css('z-index', 2001).appendTo("body");
                                progressBar.addClass("progressBar");
                                tips.addClass("progressBarTips");
                            }
                        },
                        removeProgressBar: function () {
                            $('#progressBar').remove();
                            $('#transparent_mask').remove();
                        }
                    }, config);
                }
            });

            this.fireEvent(FR.Events.ATOEXCEL);
        },

