(function ($) {

    FR.WordIframe = FR.extend(FR.BaseEditor, {

        _defaultConfig: function () {
            return $.extend(FR.WordIframe.superclass._defaultConfig.apply(), {
                baseName: 'wordIframe',
                baseClass: 'wordIframe',
                widgetName: "",
                src: "",
                width: "100%",
                height: "100%",
                showOverFlowX: true,
                showOverFlowY: true
            });
        },
        _init: function () {
            FR.WordIframe.superclass._init.apply(this, arguments);
            this.initData();
            // 控件属性
            var o = this.options;

            this.editComp = this.element.css({
                width: '100%',
                height: '100%'
            });
            o.iframeName = o.widgetName || this.createNoRepeatName();
            var location = FR.cellStr2ColumnRow(o.location);
            o.src += "&sheetIndex="+o.reportIndex;
            o.src += "&column="+location.col;
            o.src += "&row="+location.row;
            var loading_dialog_config = {
                overlay_immediately: true,
                text: FR.i18nText("Dec-Basic_Loading")
            };
            FR.showLoadingDialog(loading_dialog_config);
            this.$iframe = $("<iframe  name=" + o.iframeName + " id="
                + o.iframeName +" src="+o.src+ ">").css({
                width: o.width,
                height: o.height
            }).addClass(o.baseClass).attr({
                frameborder: 0,
                scrolling: !o.showOverFlowX && !o.showOverFlowY
                    ? 'no'
                    : 'yes'
            }).appendTo(this.editComp);
            // 这里滚动条的设置 跟子页面的设置有关
            // 如果嵌入的是我们的报表或者表单 window的尺寸都是100%那就取了iframe的大小
            // 如果报表或表单内容尺寸超过的话 就会出现滚动条 那么就改下子元素 这时一般不跨域
            this.$iframe[0].onload = function () {
                FR.hideLoadingDialog();
                if (!o.showOverFlowX || !o.showOverFlowY) {
                    try { // 可能跨域 那就不用管了
                        if (this.contentWindow) {
                            var doc = this.contentWindow.document;
                            var cc = $('.content-container', $(doc));

                            if (cc.length > 0) {
                                setOverflow(cc);
                            } else {
                                // 有可能是表单 html和body都要设置
                                setOverflow($(doc.documentElement));
                                setOverflow($(doc.body));
                            }

                            function setOverflow(cc) {
                                if (!o.showOverFlowX) {
                                    cc.css('overflow-x', 'hidden');
                                }
                                if (!o.showOverFlowY) {
                                    cc.css('overflow-y', 'hidden');
                                }
                            }
                        }
                    } catch (e) {
                        console && console.log("error");
                    }
                }
            };
        },

        createNoRepeatName: function () {
            return this.options.baseName + Math.random();
        },

        // richer:以get的方式获取ifram的参数
        _loadIframeByGet: function () {
            var src = encodeURI(this.options.src), self = this;
            // 获取参数组
            if (this.options.data) {
                var waitForInitComplete = [];
                var backupQuery = {};

                for (var i = 0, len = this.options.data.getLength(); i < len; i++) {
                    var params = this.options.data.getRecord(i).getContent();
                    if (typeof params == 'object' && params.widgetName && this.options.form) {
                        var w = this.options.form.getWidgetByName(params.widgetName);
                        if (w) {
                            var para = {};
                            para[params.widgetName] = w.getValue();
                            src = src.appendQuery(para);
                        } else {
                            waitForInitComplete.push(params.widgetName);
                        }
                    } else {
                        $.extend(backupQuery, params);
                    }
                }
                var o = this.options;
                var locationParam = {
                    sheetIndex: o.sheetIndex,
                    column: o.column,
                    row: o.row
                };
                src = self._appendQuery(src, locationParam);
                src = self._appendQuery(src, backupQuery);

                if (waitForInitComplete.length > 1) {
                    var form = this.options.form;
                    form.on(FR.Events.AFTERINIT, function () {
                        for (var c = 0; c < waitForInitComplete.length; c++) {
                            var name = waitForInitComplete[c];
                            var para = {};
                            para[name] = form.getWidgetByName(name).getValue();
                            src = src.appendQuery(para);
                        }
                        self._changeIframe(src);
                    });

                }
            }
            this._changeIframe(src);
        },
        /**
         * 给url加上给定的参数
         * @param {String} src 原地址
         * @param {Object} paras 参数对象，是一个键值对对象
         * @return {String} 添加了给定参数的url
         */
        _appendQuery: function (src, paras) {
            if (FR.isEmptyObj(paras)) {
                return src;
            }
            // 没有问号说明还没有参数
            if (src.indexOf("?") === -1) {
                src += "?";
            }
            // 如果以问号结尾，说明没有其他参数
            if (src.endWith("?") !== false) {
            } else {
                src += "&";
            }
            // 模板
            if (this.options.sourceType == 'tpl') {
                var cpParas = {};
                $.each(paras, function (pName, pValue) {
                    //后端没有encode,那就前端做
                    cpParas[encodeURIComponent(pName)] = encodeURIComponent(pValue);
                });
                src += "__parameters__=" + encodeURIComponent(FR.jsonEncode(cpParas));
            } else {
                $.each(paras, function (name, value) {
                    // web链接的参数不进行额外处理。
                    if (typeof(name) === 'string') {
                        src += name + "=" + value + "&";
                    }
                });
            }
            return src;
        },

        /**
         * 添加一层遮罩层，用于屏蔽iframe内容的可用性
         * @private
         */
        _addDisableMask: function () {
            this.mask = $('<span/>').css({
                backgroundColor: '#66B9FF',
                height: this.options.height,
                width: this.options.width,
                left: this.element.offset().left
            }).appendTo(this.element);
        },

        /**
         * 设置网页框控件的地址并重新加载页面(保留原参数)
         * @param {String} v 新的地址
         */
        setValue: function (v) {
            this.options.src = v;
            this._loadIframeByGet();
        },

        /**
         * 获取网页框的src地址
         * @returns {String} 地址
         */
        getValue: function () {
            return this.$iframe.attr("src");
        },

        _dealValueWithEvents: function (src) {
            this.options.src = src;
            this._changeIframe(src);
        },

        /**
         * 改变iframe的src指向的地址
         * @param src 新的地址
         * @private
         */
        _changeIframe: function (src) {
            this.$iframe.attr("src", src);
        },

        /**
         * 加载指定的url
         * @param url 网页地址
         */
        loadUrl: function (url) {
            this.$iframe.attr("src", url);
        },

        setEnable: function (enable) {
            FR.WordIframe.superclass.setEnable.apply(this, arguments);
            if (enable) {
                if (this.mask) {
                    this.mask.remove();
                }
            } else {
                if (this.mask) {
                    this.mask.show();
                } else {
                    this._addDisableMask();
                }
            }
        },

        doResize: function (give) {
            FR.WordIframe.superclass.doResize.apply(this, arguments);
            if (this.submitForm) {
                this.submitForm.submit();
            }
        },

        /**
         * 重置网页框控件
         */
        reload: function () {
            this.options.data.clearData();
            this._loadIframeByGet();
        }
    });
    $.shortcut('word.iframe', FR.WordIframe);
})(jQuery);
try {
    !(function () {
        window.Van = window.Van || {};
        window.Van.Helper = window.Van.Helper || {};
        window.Van.Helper.addTrialLicenseWater = function (chartEl, text, width) {

            var gap1 = 20, gap2 = 10, gap3 = 8;
            var frFont = {fontName: 'MicrosoftYaHei-Bold', size: 16},
                textDim = FR.Chart.WebUtils.stringDimensionWidthDiv(text, frFont);

            while (frFont.size >= 12 && textDim.width > width) {
                frFont.size--;
                textDim = FR.Chart.WebUtils.stringDimensionWidthDiv(text, frFont)
            }
            frFont.size = Math.max(frFont.size, 12);
            textDim = FR.Chart.WebUtils.stringDimensionWidthDiv(text, frFont);

            var r = gap1, b = gap1;

            var rectEl = chartEl.data('trail-lic-water-rect');
            var textEl = chartEl.data('trail-lic-water-text');
            if (rectEl) {
                rectEl.remove();
            }
            if (textEl) {
                textEl.remove();
            }

            rectEl = $("<div></div>");
            chartEl.data('trail-lic-water-rect', rectEl);
            chartEl.append(rectEl);

            rectEl.css({
                position: 'absolute',
                right: r,
                bottom: b,
                width: textDim.width + gap2 * 2,
                height: textDim.height + gap3 * 2,
                'background-color': '#007ED3',
                opacity: 0.5,
                'border-radius': '4px'
            });


            textEl = $("<div></div>");
            chartEl.data('trail-lic-water-text', textEl);
            chartEl.append(textEl);

            textEl.css({
                position: 'absolute',
                right: r + gap2,
                bottom: b + gap3,
                color: 'white',
                'font-family': frFont.fontName,
                'font-size': frFont.size
            });
            textEl[0].innerHTML = text;
        };
    })();
} catch (e) {
}
